class Solution {
public:
    int maximumRemovals(string S, string P, vector<int>& Removable) {
        int SLen=S.size();

        int PLen=P.size();
        
        // auto TimeMeasure=0;
        // auto TimeMeasure1=0;
        // auto begin=std::chrono::steady_clock::now();
        //auto end=std::chrono::steady_clock::now();
        vector<int> RemovedLettersInS(SLen,0);
        int LowerBound=0;
        int UpperBound=Removable.size();
        //int RemovableLen=Removable.size();
        // cout<<"SLen"<<SLen<<endl;
        // cout<<"PLen"<<PLen<<endl;
        // cout<<Removable[2956]<<endl;
        while(LowerBound<=UpperBound){
            int Mid=(LowerBound+UpperBound)/2;
            //cout<<"LowerBound "<<LowerBound<<" Mid "<<Mid<<" UpperBound "<<UpperBound<<endl;
            //begin=std::chrono::steady_clock::now();

            fill(RemovedLettersInS.begin(),RemovedLettersInS.end(),0);
            for(int i=0;i<Mid;i++){
                RemovedLettersInS[Removable[i]]=1;//mark all the removed letters in S as 1
            }
            
            //end=std::chrono::steady_clock::now();
            //TimeMeasure+=std::chrono::duration_cast<std::chrono::microseconds>(end - begin).count();
            

            //int LocInSToRemove=Removable[MaxRemove];
            //int LocInSOfPreviousLetterInP=-1;
            //int Affected=0;
            int PIsSSubsequenceOrNot=1;
            //auto begin1=std::chrono::steady_clock::now();
            //fill(NewMinOccurLocInCounterForLettersInP.begin(),NewMinOccurLocInCounterForLettersInP.end(),0);
            int PointerInP=0;
            int PointerInS=0;
            while(PIsSSubsequenceOrNot==1&&PointerInP<PLen){
                while(PointerInS<SLen&&(RemovedLettersInS[PointerInS]==1||S[PointerInS]!=P[PointerInP])){
                    PointerInS++;
                }
                if(PointerInS==SLen){
                    PIsSSubsequenceOrNot=0;
                    //break;
                }
                else{
                    PointerInP++;
                    PointerInS++;
                }
            }
            // if(Mid==2957){
            //     cout<<PIsSSubsequenceOrNot<<endl;  
            //     cout<<PointerInS<<endl;  
            //     cout<<PointerInP<<endl;
            // }

            // auto end1=std::chrono::steady_clock::now();
            // TimeMeasure1+=std::chrono::duration_cast<std::chrono::microseconds>(end1- begin1).count();

            if(PIsSSubsequenceOrNot==0){//this means P is not a subsequence of S
                UpperBound=Mid-1;
            }
            else{
                LowerBound=Mid+1;
            }

        }
        //auto end=std::chrono::steady_clock::now();
       // TimeMeasure+=std::chrono::duration_cast<std::chrono::microseconds>(end - begin).count();
        //cout<<"Total Run time for marking ="<<TimeMeasure<<"ms\n";
        //cout<<"Run time for finding FindNextLoc="<<TimeMeasure1<<"ms\n";
        return UpperBound;
    }
};

